import React from "react";
// import DataTable from "react-data-table-component";
// import DataTableExtensions from "react-data-table-component-extensions";
// import "react-data-table-component-extensions/dist/index.css";
// import { columns, data } from "./Data.jsx";
import DataTable from "react-data-table-component";

const data = [{ id: 1, title: "DataTable in ReactJS", year: "2021" }];
const columns = [
   {
      name: "Name",
      selector: "name",
      sortable: true,
   },
   {
      name: "Username",
      selector: "username",
      sortable: true,
   },
   {
      name: "Email",
      selector: "email",
      sortable: true,
   },
   {
      name: "Phone",
      selector: "phone",
      sortable: true,
   },
   {
      name: "Website",
      selector: "website",
      sortable: true,
   },
];
const Table = () => {
   return (
      <Datatable
         title="YourBlogCoach"
         columns={columns}
         data={data}
      ></Datatable>
   );
};

export default Table;
